import { useEffect, useState } from 'react';

const PostFetch = () => {
    const [posts, setPosts] = useState([]);

    useEffect(() => {
        fetch('https://jsonplaceholder.typicode.com/posts')
            .then(res => {
                return res.json();
            })
            .then(resdata => {
                setPosts(resdata);
            })
    }, [])

    const postList = posts.map((post) => (
        <div>
            <p>&#123</p>
            <p>{post.title}</p>
            <p>{post.body}</p>
            <p>&#123</p>
        </div>
    ))

    return (
        <div>
            <p>[</p>
                {postList}
            <p>]</p>
        </div>
    );
}

export default PostFetch;
